import React, {Component} from "react";

export default class ItemBoxComponent extends Component{

    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div className="box">
                <img src={this.props.item.photo ? "data:image/png;base64,"+this.props.item.photo : require()}/>
            </div>
        );
    }
}
